                </div>

            <div class="flex justify-end mt-6">
                <button id="ajouterDVD" class="px-6 py-2 leading-5 text-fumee transition-colors duration-200 transform bg-granny-400 rounded-md hover:bg-granny-600 focus:outline-none" >Ajouter</button>
